// Criar Fundos/Life11/Inadimplencia.js
import React from "react";

const Inadimplencia = () => {
  return (
    <div className="operacao-container">
      <h2 className="operacao-title">Histórico de Inadimplência</h2>
      <p>Os gráficos serão adicionados aqui futuramente.</p>
    </div>
  );
};

export default Inadimplencia;
